import React from "react";

const Section2 = () => {
  return (
    <section>
      <div>
        <h2>Latest episodes</h2>
        <button>View all episodes</button>
      </div>
      <div className="BlackRectangle"></div>
      <div className="BlackRectangle"></div>
      <div className="BlackRectangle"></div>
    </section>
  );
};

export default Section2;
